import React from "react";

const MessageBox = () => {
    return (
        <Footer>
        <div class="input-group">
            <input class="form-control width100"/>
            <span class="input-group-btn">
                <button class="btn btn-info">Submit</button>
            </span>
        </div>
        </Footer>
    )
};

export default MessageBox;
